import React, { Component } from "react";
import "./index.css";
export default class Footer extends Component {
  render() {
    return (
      <div className="todo-footer">
        <label>
          <input type="checkbox" />
        </label>
        <span>
          <span>Finished 0</span>/ all 2
        </span>
        <button className="btn btn-danger">Delete the finished task</button>
      </div>
    );
  }
}
